import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { Footer } from './App';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <App />
);

const foot_root = ReactDOM.createRoot(document.getElementById('foot_root'));
foot_root.render(
    <div>
        <Footer />
    </div>
);
